export function parseVEP(data) {

    let results = []

    if (data.error) {

        results.push(data.error)

    } else if (data[0]) {
        let scores = data[0].transcript_consequences

        for (var i = 0; i < scores.length; i++){
            let score = scores[i]

            const VEP = {
                exists: true,
                metaSVM: score.metasvm_score,
                sift_score: score.sift_score,
                polyphen_score: score.polyphen_score,
                cadd_raw: score.cadd_raw,
                polyphen2_hdiv_score: score.polyphen2_hdiv_score,
                metalr_score: score.metalr_score,
            }

            results.push(VEP)
        }
        return results

    } else {
        const VEP = {
            exists: false
        }
        results.push(VEP)

        return results
    }

    console.log(results)

    const test = "Does this work"

}
